import copy
def run():
  original_grid = build_grid("day6.input")  
  guard_pos = find_guard(original_grid)

  loop_count = 0
  path = path_indices()
  for r in range(len(original_grid)):
    for c in range(len(original_grid[r])):
      if (r, c) not in path:
        continue
      
      print(f"({r}, {c})")
      if not edit_obstacle(original_grid, r, c, 'check'):
        continue

      grid = copy.deepcopy(original_grid)
      edit_obstacle(grid, r, c, 'add')

      if simulate(grid, guard_pos) == 'loop':
        loop_count += 1
      
      edit_obstacle(grid, r, c, 'remove')

  print(f"loop count: {loop_count}")

def simulate(grid, guard_pos):
  i = 0
  while True:
    (result, guard_pos) = step_grid(grid, guard_pos)
    if result == 'halt':
      return 'halt'
    if result == 'loop':
      return 'loop'
    i += 1

def build_grid(path):
  grid = []
  with open(path, 'r') as f:
    for line in f:
      parts = list(line.strip())
      new_row = []
      for part in parts:
        is_guard = part == '^'
        visited = {part} if is_guard else set()
        entry = {
          "display": part,
          "guard": part,
          "is_guard": is_guard,
          "visited_directions": visited,
        }
        new_row.append(entry)
      grid.append(new_row)
  
  return grid

def step_grid(grid, guard_pos):
  (r, c) = guard_pos
  
  old = grid[r][c]
  guard = old["guard"]
  (dr, dc) = get_dir(guard)

  nr = r + dr  
  nc = c + dc

  is_in_bounds = in_bounds(grid, nr, nc)

  display = '-' if guard == '>' or guard == '<' else '|'

  if is_in_bounds and has_obstacle(grid, nr, nc):
    new_guard = turn(guard)
    old["display"] = display
    old["guard"] = new_guard
    old["is_guard"] = False

    # we have come this way before
    if new_guard in old["visited_directions"]:
      return ('loop', None)

    old["visited_directions"].add(new_guard)

    return ('continue', (r, c))
  elif is_in_bounds:
    old["guard"] = display
    if len(old["visited_directions"]) > 1:
      old['display'] = '+'
    else:
      old["display"] = display 
    old["is_guard"] = False

    _new = grid[nr][nc]
    _new["guard"] = guard
    _new["display"] = guard
    _new["is_guard"] = True
    _new["visited_directions"].add(guard)
    return ('continue', (nr, nc))
  else: # out of bounds
    old["guard"] = 'X'
    old["display"] = display
    old["is_guard"] = False

    return ('halt', None)

def count_positions(grid):
  sum = 0
  for row in grid:
    for item in row:
      if item["guard"] == 'X':
        sum += 1

  return sum

def print_grid(grid):
  for row in grid:
    print(''.join([item["display"] for item in row]))

def turn(guard):
  turns = ['^', '>', 'v', '<']
  return turns[(turns.index(guard) + 1) % 4]

def has_obstacle(grid, r, c):
  return grid[r][c]["guard"] == '#' or grid[r][c]["guard"] == "0"

def edit_obstacle(grid, r, c, operation):
  if not in_bounds(grid, r, c):
    return False
  
  if has_obstacle(grid, r, c):
    return False

  foo = grid[r][c]

  if foo["guard"] == '^':
    return False

  if operation == 'check':
    return True

  entry = "0" if operation == 'add' else "."
  foo["display"] = entry
  foo["guard"] = entry
  return True

def in_bounds(grid, r, c):
  if r < 0 or c <0:
    return False  

  if r >= len(grid):
    return False

  if c >= len(grid[r]):
    return False

  return True

def get_dir(guard):
  match guard:
    case '^':
      return (-1, 0)
    case '>':
      return (0, 1)
    case '<':
      return (0, -1)
    case 'v':
      return (1, 0)
    case _:
      raise f"invalid guard: {guard}"

def find_guard(grid):
  for r in range(len(grid)):
    for c in range(len(grid[r])):
      if grid[r][c]["is_guard"]:
        return (r, c)

  return None

